import {Component} from "react";

class LogInForm extends Component {
    render() {
        return (
            <div className="login-form">
                <h3>Please log in</h3>
                <form>
                    <label>
                        Username:
                        <input type="text"/>
                    </label>
                    <label>
                        Password:
                        <input type="password"/>
                    </label>
                    <div>
                        <br/>
                        <button className="btn" type="submit">Log in</button>
                    </div>
                </form>
            </div>
        );
    }
}

export default LogInForm;
